import React from 'react'

export default function CategoryBar({getGenreId}) {
  return (
      <div className='flex flex-row pb-1 justify-evenly items-center h-12 bg-gradient-to-b  from-slate-500 via-slate-100 to-slate-50 font-semibold shadow-xl shadow-slate-600'>
        <div onClick={() => getGenreId(27)} className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-lg'><a href="#">  Aksiyon  </a></div>
        <div onClick={() => getGenreId(27)} className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-lg'><a href="#">  Komedi  </a></div>
        <div onClick={() => getGenreId(27)} className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-lg'><a href="#">  Drama  </a></div>
        <div onClick={() => getGenreId(27)} className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-lg'><a href="#">  Korku  </a></div>
        <div onClick={() => getGenreId(27)} className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-lg'><a href="#">  Bilim-Kurgu  </a></div>
        <div onClick={() => getGenreId(27)} className='text-stone-600 hover:text-black hover:underline underline-offset-4 text-lg'><a href="#">  Tarih  </a></div>
      </div>
  )
}
